observe({
    colorBy <- input$color
    sizeBy <- input$size
    if (colorBy == "superzip") {
        colorData <- ifelse(zipdata$centile >= (100 - input$threshold), 
            "yes", "no")
        pal <- colorFactor("viridis", colorData)
    }
    else {
        colorData <- zipdata[[colorBy]]
        pal <- colorBin("viridis", colorData, 7, pretty = FALSE)
    }
    if (sizeBy == "superzip") {
        radius <- ifelse(zipdata$centile >= (100 - input$threshold), 
            30000, 3000)
    }
    else {
        radius <- zipdata[[sizeBy]]/max(zipdata[[sizeBy]]) * 
            30000
    }
    leafletProxy("map", data = zipdata) %>% clearShapes() %>% 
        addCircles(~longitude, ~latitude, radius = radius, layerId = ~zipcode, 
            stroke = FALSE, fillOpacity = 0.4, fillColor = pal(colorData)) %>% 
        addLegend("bottomleft", pal = pal, values = colorData, 
            title = colorBy, layerId = "colorLegend")
})

